// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract TodoList {
    struct Todo {
        string text;
        bool isCheck;
    }
    Todo[] todoList;

    function createTodo(string calldata text) external {
        todoList.push(Todo(text, false));
    }
}

